地震や火災などの災害に、いつどこで遭遇しても脱出できる必要最低限のセット！<br>
<br>
高層ビルや、巨大なショッピングモール、工場や学校、病院等での災害や火災時の停電などによる暗闇を想定し、いち早く安全な場所へ避難するための必要最低限の緊急脱出セットです。<br>
<br>
【セット内容】<br>
■緊急脱出用バッグ<br>
緊急時の必要最低限の脱出キットを入れるためのバッグです。<br>
薄くて、軽量コンパクトな為、オフィスのデスクの引き出しや、通勤かばんの中に入れておけます。<br>
<br>
■シールド付き防災マスク<br>
シールド付使い捨て防災マスク。<br>
火災時の防災マスクとして、シールドが目を保護し視界を確保すると同時に同封された水袋をつぶして、マスクに吸着させ吸い込みにくくします。また片手で口と鼻を押さえるなど必要がない為、両手が自由にできるので、安全に避難することができます。<br>
<br>
■LEDマーカー<br>
内蔵バッテリーの寿命まで何度でも使える、使い捨て、防水型LEDマーカー。<br>
点灯、点滅消灯の3段階切り替え、24時間以上連続で、点灯、点滅し続けます。<br>
災害時の非常用ライトとして、危険個所の夜間表示として、道迷い防止や、テントサイトのつまずき防止として、火災時の誘導灯として、様々にお使いいただけます。<br>
<br>
■大閃光ケミカルライト<br>
カチッと折るだけで、懐中電灯並みの明かりが広がります。化学発光の為、発熱せず、引火性が無い為、ガス漏れなどの場合にも使用でき、酸素も必要としないので、水中でも使用できます。発光時間は15分ですが、地震や火災などによる停電時や夜間の災害時の非常灯としてもとても便利です。<br>
<br>
■緊急脱出マニュアル＆パーソナルメモ<br>
パーソナルメモ<br>
災害時の緊急脱出マニュアルと、名前、血液型、連絡先などのパーソナルメモをカードホルダーにセットし災害時に必要な最低限の情報を記入することにより、災害時の緊急対応と、ケガなどに素早く対応できます。<br>
